import { useAppSelector } from "../../store/hooks";

const Export = () => {
  const state = useAppSelector((state) => state);
  console.log("State, ", state.export);
  return (
    <div>
      <h1>
        <center>ExportJSON</center>
      </h1>
      {JSON.stringify(state.export)}
      <textarea
        onChange={() => {}}
        value={JSON.stringify(state.export)}
        className={`${styles["text-area"]}`}
        name="Open Api Json"
        rows={20}
      />
    </div>
  );
};
export default Export;
